    public static ArrayList<Long> factorize(long n) {
        ArrayList<Long> result = new ArrayList<Long>();
        long i = 2;
        while (n > 1) {
            if (n % i == 0) {
                result.add(i);
                n /= i;
            } else {
                i += 1;
            }
        }
        return result;

