    // (true)
    // # 3+2+3 is less than the maximum possible weight, and it's balanced.
    // >>> willItFly((new ArrayList<Long>(Arrays.asList((long)3l))), (5l))
    // (true)
    // # 3 is less than the maximum possible weight, and it's balanced.
    public static boolean willItFly(ArrayList<Long> q, long w) {
        if (q.size() == 0)
            return true;
        if (q.size() == 1)
            return q.get(0) <= w;

        long sum = 0;
        for (int i = 0; i < q.size(); i++)
            sum += q.get(i);

        if (sum > w)
            return false;

        int mid = q.size() / 2;
        ArrayList<Long> left = new ArrayList<Long>(q.subList(0, mid));
        ArrayList<Long> right = new ArrayList<Long>(q.subList(mid, q.size()));

        return willItFly(left, w) && willItFly(right, w);

