    // Write a function that returns true if the given number is the multiplication of 3 prime numbers
    // and false otherwise.
    // Knowing that (a) is less then 100. 
    // Example:
    // >>> isMultiplyPrime((30l))
    // (true)
    // 30 = 2 * 3 * 5
    public static boolean isMultiplyPrime(long a) {
        int count = 0;
        long n = a;
        for(int i = 2; i <= n; i++) {
            if(n % i == 0) {
                count++;
                n /= i;
                i--;
            }
        }
        return count == 2;

