                result.add("C");
            } else if (g >= 1.3f) {
                result.add("C-");
            } else if (g >= 1.0f) {
                result.add("D+");
            } else if (g >= 0.7f) {
                result.add("D");
            } else if (g >= 0.0f) {
                result.add("D-");
            } else {
                result.add("E");
            }
        }
        return result;

