class Problem {
    // Given a positive integer n, return the count of the numbers of n-digit
    // positive integers that start or end with 1.
    public static long startsOneEnds(long n) {
        long count = 0;
        if (n == 1)
            return 2;
        else if (n == 2)
            return 3;
        else {
            count += 2;
            count += (n - 2) * 9;
            count += startsOneEnds(n - 1);
        }
