    public static boolean isNested(String string) {
        int open = 0;
        for(int i = 0; i < string.length(); i++) {
            if(string.charAt(i) == '[') {
                open++;
            }
            else {
                open--;
                if(open < 0) {
                    return false;
                }
            }
        }
        return open != 0;

